import { count } from "../../../model/user";

const initState = {
    count : 10
}

const UserReducer = (state = initState,action) => {

     switch (action.type) {
         case "INCREASE":

            return {
                count : state.count + 1
            }



         default:
                    return initState


     }


}



export default UserReducer
